import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Library navigation item to be visible
    await page.waitForSelector('.nav-item[data-page="library"]');

    // Click on the Library navigation item
    await page.click('.nav-item[data-page="library"]');

    // Take a screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_library_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_library_clicked.png'));

    // Verify that the Library page is loaded by checking the URL or a specific element
    const isLibraryPage = await page.evaluate(() => {
      return document.querySelector('.nav-item[data-page="library"].active') !== null;
    });

    return {
      success: true,
      action: "Clicked on the Library navigation item",
      extractedData: { isLibraryPage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

